import React, { Component } from "react";

class Warning extends Component {
    styleObj = {
        background:"indianred"
    }
    render() {
        return (
            <div style={this.styleObj} className =" text-dark border border-danger">
                Warning
            </div>

        )
    }
}

export default Warning;
